// RegistrationForm.js

import React from 'react';
import { Form } from 'react-final-form';

const validate = (values) => {
  const errors = {};
  if (!values.firstName) {
    errors.firstName = 'First Name is required';
  }
  if (!values.lastName) {
    errors.lastName = 'Last Name is required';
  }
  // Add validation rules for other fields (e.g., zipCode, ssn, dob, email, phone) similarly
  return errors;
};

const RegistrationForm = () => {


  return (
    <Form
      onSubmit={onSubmit}
      render={({ handleSubmit }) => (
        <form onSubmit={handleSubmit}>
          <div>
            <label>First Name</label>
            <input name="firstName" component="input" type="text" />
          </div>
          <div>
            <label>Last Name</label>
            <input name="lastName" component="input" type="text" />
          </div>
          <div>
            <label>Legal Zip Code</label>
            <input name="zipCode" component="input" type="text" />
          </div>
          <div>
            <label>Social Security Number</label>
            <input name="ssn" component="input" type="text" />
          </div>
          <div>
            <label>Date of Birth</label>
            <input name="dob" component="input" type="text" />
          </div>
          <div>
            <label>Email Address on File</label>
            <input name="email" component="input" type="text" />
          </div>
          <div>
            <label>Phone Number on File</label>
            <input name="phone" component="input" type="text" />
          </div>
          <button type="submit">Continue</button>
        </form>
      )}
    />
  );
};

const onSubmit = (values) => {
  // Handle form submission here
  console.log(values);
};

export default RegistrationForm;
